import React from "react";
import "./footer-style.css";

const Footer = () => {
  return (
    <div>
      <div className="py-2 text-center footer-style"> 
        <h3>Govind Nair</h3>
        <footer>
          Made using React.js, Bootstrap and coffee.
        </footer>
      </div>
    </div>
  );
};

export default Footer;
